import React from 'react'
import '../Home.css';
import 'bootstrap/dist/css/bootstrap.min.css';

//import calcula from "../images/calculadora.png";

function Calculadora(){

    var valor = document.getElementById("valor").value;
    var quantidade = document.getElementById("quantidade").value;
    //var var_quant = valor / quantidade;
    document.write("var_quant");

    return (
    <div class="container " style={{marginTop:'80px'}}>          
        <div class="row">
            <form id="cadastro">
                <label>Valor</label>
                <input type="text" id="valor"/>
                <label>Quantidade</label>
                <input type="text" id="quantidade"/>
                <label>Valor/Quantidade</label>
                <input type="text" id="var_qnt" value=''/>
            </form>     
        </div>        
    </div>
        
    );
}

export default Calculadora;
